import math

def threeEqualParts(arr):
     num=0 
     n=len(arr)
     for x in range(0, n):
         if arr[x] == 1:
             num+=1<<(n-x-1)

     second_pt=num
     if  num == 0:
         return [0, n-1]
     count=0

     for x in range(0, n):
         count<<=1
         count+=arr[x]
         if arr[x]==1:
             second_pt-=1<<(n-x-1)
         middle=second_pt-count
         if middle > 0 and count > 0 and middle%count==0 and ( middle//count & -(middle//count) ) == middle//count:
             length=int(math.log(middle//count)/math.log(2))
             i=0
             while arr[i] == 0:
                 i+=1
             if n - x-1 - max(length, x+1-i)  >=  x+1-i and length > x-i:
                 return [x, n-length]
     return [-1, -1]


